import React, { Component } from 'react';

import Sidebar from './components/sidebar/Index'
import Video from './components/video/Index'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Video />
        <Sidebar />
      </div>
    )
  }
}

export default App;
